import React from "react";

const UserProfile = () =>{
    const [getPhoto, setPhoto] = useState('https://media.istockphoto.com/photos/cat-world-picture-id1311993425?b=1&k=20&m=1311993425&s=170667a&w=0&h=vFvrS09vrSeKH_u2XZVmjuKeFiIEjTkwr9KQdyOfqvg=')
    function changePh(){
        setPhoto('https://www.rd.com/wp-content/uploads/2021/04/GettyImages-988013222-scaled-e1618857975729.jpg')
    }

    return (
        <div>
            <img src="{getPhoto}" alt="" />
            <button onClick = {changePh} >Change Photo</button>
        </div>
    )
}
export default UserProfile
